import React from "react";
import notes from "../notes";

function Note(){
return(
<div>
{notes.map((newNote) => (
    <NewNoteEntry
    key={newNote.key}
    title={newNote.title}
    content={newNote.content}
    />
))}
</div>

);
}
export default Note;
